
import { Product } from './types';

const determineCategory = (id: string): string => {
  if (id.startsWith('TF') || id.startsWith('TP')) return '儿童用品';
  if (id.startsWith('C')) return '宠物用品';
  if (id.startsWith('P')) return '皮具';
  if (id.startsWith('E')) return '配件/辅料';
  if (id.startsWith('S')) return '饰品';
  if (id.startsWith('W')) return '外采';
  return '未分类';
};

